import React, { useEffect, useState } from 'react';
import api from '../../utils/api';

const ManageUsers = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Log initial render
    console.log('ManageUsers component mounted');
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      console.log('Starting users fetch');
      setError(null);
      setLoading(true);

      // Log auth token
      const token = localStorage.getItem('token');
      console.log('Current auth token:', token ? 'Present' : 'Missing');

      const response = await api.get('/api/users');
      console.log('Users fetch successful:', response.data);

      setUsers(response.data);
    } catch (error) {
      console.error('Users fetch error:', {
        message: error.message,
        response: error.response,
        status: error.response?.status,
        data: error.response?.data
      });

      setError(
        error.response?.data?.message || 
        error.message || 
        'Error fetching users'
      );
    } finally {
      setLoading(false);
      console.log('Users fetch completed');
    }
  };


  const handleRoleChange = async (userId, newRole) => {
    try {
      setError(null);
      await api.put(`/api/users/${userId}/role`, { role: newRole });
      fetchUsers();
    } catch (error) {
      setError(error.response?.data?.message || 'Error updating user role');
      console.error('Error updating user role:', error);
    }
  };

  const handleDeleteUser = async (userId) => {
    if (window.confirm('Are you sure you want to delete this user?')) {
      try {
        setError(null);
        await api.delete(`/api/users/${userId}`);
        fetchUsers();
      } catch (error) {
        setError(error.response?.data?.message || 'Error deleting user');
        console.error('Error deleting user:', error);
      }
    }
  };

  if (loading) return (
    <div className="flex justify-center items-center h-64">
      <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-gray-900"></div>
    </div>
  );

  return (
    <div className="max-w-4xl mx-auto p-4">
      <h2 className="text-2xl font-bold mb-4">Manage Users</h2>

      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error}
        </div>
      )}

      <div className="overflow-x-auto">
        <table className="min-w-full bg-white shadow-md rounded">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 border-b text-left">Name</th>
              <th className="px-6 py-3 border-b text-left">Email</th>
              <th className="px-6 py-3 border-b text-left">Role</th>
              <th className="px-6 py-3 border-b text-left">Actions</th>
            </tr>
          </thead>
          <tbody>
            {users.map((user) => (
              <tr key={user._id} className="hover:bg-gray-50">
                <td className="px-6 py-4 border-b">{user.name}</td>
                <td className="px-6 py-4 border-b">{user.email}</td>
                <td className="px-6 py-4 border-b">
                  <select
                    value={user.role}
                    onChange={(e) => handleRoleChange(user._id, e.target.value)}
                    className="border rounded px-2 py-1 focus:outline-none focus:ring-2 focus:ring-blue-500"
                  >
                    <option value="user">User</option>
                    <option value="admin">Admin</option>
                  </select>
                </td>
                <td className="px-6 py-4 border-b">
                  <button
                    onClick={() => handleDeleteUser(user._id)}
                    className="bg-red-500 text-white px-3 py-1 rounded hover:bg-red-600 focus:outline-none focus:ring-2 focus:ring-red-500"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ManageUsers;
